材料并承接各类亚克力工程和水族缸体制作。\r\n三、海洋水族生物介绍\r\n　　　\r\n　　　水母\r\n　　　水母是6.5亿年前一种神奇的动物，身体的95%都是水分。，她们种类繁多，形态各异，色彩斑斓，是一类有很高观赏价值的物种。目前已知的有250多个种类。目前，实现人工养殖的水母 有海月水母、赤月水母、巴布亚硝水母、澳洲斑点水母等十多种。\r\n　　　珊瑚\r\n　　　珊瑚属腔肠动物门，珊瑚虫纲。它们体态玲珑，色泽鲜艳非常好看。生活在热带和亚热带。公司现有彩色地毯、绿脑、奶嘴、圣诞树、猫眼、纽扣、宝石花、九尾狐等上百种不同种类的珊瑚。\r\n　　　海水鱼\r\n　　　海水观赏鱼色彩丰富，极富变化，具有一种原始古朴神秘的自然美。公司现有神仙类、吊类、蝶类等海水鱼中近200种不同形态的种类。\r\n　　　海马\r\n　　　海马是珍贵的药材，也是国家二级保护动物。公司开展了大量关于海马的人工繁育与养殖研究。人工繁育的海马可以用于增殖放流，丰富海马资源，也可以养成成体，加工为药材，丰富海马药材市场，同时也能缓解野生海马的资源压力。\r\n　　四、海洋生态修复工程\r\n　　　近年来，过度捕捞、海洋污染、海洋和海岸工程建设、滩涂利用、全球变暖等各类因素，致使海洋生态失衡，渔业资源严重破坏。海洋生态修复工作显得迫切而必要。\r\n　　　目前，海洋生态修复的手段有设置伏季休渔、人工增殖放流、人工鱼礁与海洋牧场建设、溢油回收等手段。这些手段有效地改善了海洋生态环境。\r\n　　　本公司立志于利用企业优势，承接海洋生态修复业务，参加海洋生态修复项目，为海洋强国、海洋生态修复工作尽绵薄之力。',36.104046,120.476876),(493,5,0,'http://www.cmfish.com/cd/cd.php?id=218&hot=23896','2018-04-06 05:34:20',218,23896,'2012-08-30','中国珊瑚礁农场(CRF)','包','13968818057 QQ:577888586','sales@chinareef.com','浙江省温州市','　中国珊瑚礁农场(CRF)是一家人工繁育海洋观赏鱼类、藻类、无脊椎动物、及生产高品质观赏鱼饲料的企业。位于海峡西岸经济区五大中心城市之一浙江省温州市。CRF是国内最大的海洋观赏鱼繁殖中心，我们不断开发创新技术，向世界各地提供海洋环保意识，给海水水族业带来最完美的人工繁殖海水观赏鱼。\r\n\r\n　　CRF的人工海水观赏鱼帮您避免野生捕捞海水观赏鱼所代来的的不稳定性，我们的鱼有很强的人工环境适应能力，它们是极其顽强的水族箱居民。我们繁育出的每条小鱼都具备完美的比例和鲜艳的色彩，更接近于自然礁石上的野生鱼类。我们通过搭配天然活体饵料和人工颗粒饲料已达到营养的均衡，这可以让我们的鱼更加艳丽，更具抵抗力。\r\n\r\n　　CRF的使命是研究和生产繁育高品质海洋观赏鱼类和无脊椎动物。 CRF致力于提供现代海水水族更健康的和更具有吸引力的替代野生捕捞的生物。 CRF人工繁育物种有助于减少珊瑚礁的过度捕捞，保护海洋生态环境并为水族爱好者提供了一个更好的成功机会。\r\n\r\n　　CRF的最终目标是要提供全方位及高品质的海水观赏类产品。这是我们的承诺，以及更好的保护天然的珊瑚礁环境。\r\n\r\n',28.002838,120.690635),(494,5,0,'http://www.cmfish.com/cd/cd.php?id=172&hot=863','2018-04-06 05:34:20',172,863,'2014-04-19','腾飞水族','孙生','15811808556','1406315627@qq.com','例如:xx省xx市xx区xx街xx号,直辖市不用填省..','专业 批发龟 淡化龟 ',NULL,NULL),(495,5,0,'http://www.cmfish.com/cd/cd.php?id=160&hot=22685','2018-04-06 05:34:20',160,22685,'2014-04-04','★★精品SPS断肢★★','沈先生','微信: 15857372278','28581112@qq.com','浙江省 嘉兴市 南湖区 巴黎都市 维莱特宫7栋 1602','请关注微信.持续更新SPS断肢.\r\n精品断肢 全国发货 顺丰包邮.\r\n提供视频选货服务.\r\n\r\n澳洲高品质断肢. 红樱桃 草莓蛋糕等.\r\n微信: 15857372278',30.749120,120.785333),(496,5,0,'http://www.cmfish.com/cd/cd.php?id=143&hot=