 05:34:25',243,997,'2012-12-26','北京旭阳国际展览有限公司','zhanglei','18612938661','18612938661@139.com','例如:xx省xx市xx区xx街xx号,直辖市不用填省..','2013中国（青岛）国际水族精品暨宠物休闲展览会\r\nChina (QingDao) Int\'l Aquarium Goods &amp; Pet Leisure Expo 2013   \r\n时间：2013年6月8—10日           地点：青岛国际会展中心\r\n批准单位：中国国际贸易促进委员会\r\n主办单位：国际休闲产业协会    青岛市旅游局    \r\n承办单位：北京旭阳国际展览有限公司\r\n支持单位：欧洲水族馆馆长联盟    中国城市经济学会    台湾水族类商业同业公会  \r\n亚太旅游协会         中国百货商业协会     中国休闲垂钓协会   \r\n协办单位：一度商业传媒集团    青岛市供应商商会    牧野钓鱼俱乐部     青岛水族馆专业委员会\r\n青岛市跨国采购中心    青岛市体育总会      青岛市旅游协会\r\n特邀媒体：CCTV-生活频道    CCTV-经济频道   人民网     搜狐网     新浪网    美联社   \r\n战略合作媒体：半岛都市报     城市信报     半岛网     水族世界\r\n展会前言：                                                                \r\n     随着世界经济的发展和一体化步伐的加快，消费的格局和生活方式有着重大的改变，由物质生活消费进入休闲生活消费时代。家庭休闲水族体现最为突出。目前世界观赏鱼行业正以每年10％的速度增长，我国13亿城镇人口中将有40%的家庭将观赏鱼作为宠物在饲养。水族箱有健康、环保的美称；家庭放上一个水族箱，无异于在家中安了一个加湿器，可以起到增加居室湿度、滋润空气的作用。还具有不吵闹、不扰民、不污染环境、不传染人畜共患疾病，安全性高等明显优点。这些必将为水族产业的发展提供更为广阔的前景。\r\n同时在经济活动日益自由化、国际化的情况下，宠物经济也日益向全球每个角落渗透。随着经济的发展的中国的消费水平日益提高，标志着宠物市场发展的时机已经成熟。中国是个人口大国，宠物市场涌现出的商机不可小觑，也正是看到了中国巨大的商机，国外一些著名企业将目光投向中国市场，国际知名水族及宠物用品企业纷纷抢占中国市场。实力雄厚的跨国宠物公司为了争夺中国的市场投放了大量的广告，而且广告均富有创意和创新，由此提高了中国消费者对其认知度，更着力打造在中国消费者心目中的品牌形象，同时挤占中国的市场份额，迅速占领中国市场，致力于在日益激烈的市场竞争中同中国本土迅速成长的品牌分食一杯羹。\r\n      青岛作为我国重要的沿海开放城市之一,水族及宠物休闲产业发展迅速,科研和科普能力不断增强,为了更好发展青岛水族精品、宠物休闲市场。由国际休闲产业协会、青岛市旅游局联合主办的“2013中国（青岛）国际水族精品暨宠物休闲展览会”将于2013年6月8-10日在青岛国际会展中心召开。本次展会将是目前国内外最权威、最专业、针对性最强的水族及宠物交流交易盛会。\r\n青岛优势：                                                                \r\n▼ 青岛以山闻名。历史悠久的道教圣地--崂山，是中国海岸线第一高峰，有“海上名山第一”之誉。2014\r\n年青岛世界园艺博览会将在崂山北部百果山森里公园举行，届时将有上千万游客参观游览。青岛还有\r\n珠山、浮山、信号山等136个山头适合登山，青岛连续八届作为全国群众健身登山大会主、分会场，举\r\n行全民登山健身活动。\r\n▼ 青岛以海为傲。青岛海岸线曲折，岬湾相间，沙滩广布。位于汇泉湾畔的青岛第一海水浴场，是亚洲最大的海水浴场之一。\r\n▼ 青岛以湖为荣。莱西湖可举行环湖自行车、铁人三项、马拉松、滑水、龙舟、钓鱼等训练和比赛，是\r\n全国知名的水上运动、自行车和垂钓等休闲运动场地，先后举办了数十次全国和省级自行车、钓鱼赛\r\n事及群众性自行车、越野赛等活动。\r\n▼ 青岛还拥有胶东半岛最大的内陆湿地--姜山湿地，目前湿地内建有水上高尔夫球场、水族馆、海洋科\r\n技馆、海底世界等休闲运动场地\r\n▼ 青岛市成功申办2015年世界休闲体育大会，得益于青岛所拥有的优越的休闲资源和雄厚的经济实力。\r\n展会时间                                                                \r\n报道布展：2013年6月 6—7日      开幕式：2013年6月8日 9：30\r\n展示交易：2013年6月8—10日     撤  展：2013年6月10日14：00\r\n展览地点：中国-青岛国际展览中心 （山东省青岛市高新区世纪广场(苗岭路9号)\r\n展示范围:                                                                \r\n◎ 水族类：观赏鱼、鱼缸、饰物、增氧设备、过滤器材、水槽沙、加热棒、水草、鱼饲料、造景、喷水设备、护理产品水族工程等； \r\n◎ 爬行及两栖：各种爬行及两栖宠物、水族箱、饲料等； \r\n◎ 花园宠物：室外喷泉、养鱼池、冷水鱼类、丝网、过滤器、水泵、饲料、环保、鸟舍、喂养器具、过\r\n冬食物等； \r\n◎ 鸟类：观赏鸟、鸟舍、饲料、药品等； \r\n◎ 猫狗类：猫狗食品、宠物咀嚼食品、训狗用品、犬舍、猫窝、服装、牵引带、宠物玩具等各类用品及\r\n保健护理用品、美容用品、医疗仪器设备等； \r\n◎ 马具：服装, 马鞍/鞍垫、笼头、美食、马棚设备、美容产品、饰品、保健用品等； \r\n◎ 其他：宠物书刊及宠物运输工具等。\r\n',NULL,NULL),(535,7,0,'http://www.cmfish.com/cd/cd.php?id=219&hot=1080','2018-04-06 05:34:25',219,1080,'2012-09-19','海水渔友水族馆','DEREK','18922433111','luohantang@126.com','广州花地湾越和花鸟鱼市N15','',23.093241,113.238847),(536,7,0,'http://www.cmfish.com/cd/cd.php?id=211&hot=761','2018-04-06 05:34:25',211,761,'2012-08-18','广州市恒丰水族用品商行','王生/肖生','1660804199/13316056290/QQ575984480','575984480@qq.com','广州市花都区新华街杏林花园17号之5','     生产鱼缸及地柜，经销德国德彩、德国喜瑞、德国JBL、红十字、德国黑钻鱼缸、日本KOTOBUKI、德国伊罕、恒丰鱼缸、捷宝、创星、日生、海利.........及海淡水观赏鱼，并专业设计鱼池过滤系统、及水族箱景观，提供上门维护服务。为开拓展国内外市，欢迎国内外新老客洽谈业务。\r\n\r\n                                                  恒丰水族用品商行\r\n\r\n',23.403604,113.213868),(537,7,0,'http://www.cmfish.com/cd/cd.php?id=207&hot=1042','2018-04-06 05:34:25',207,1042,'2012-09-11','海南水族之家','莫先生','18876622709','18876622709@163.com','海南海口','',20.022071,110.330802),(538,7,0,'http://www.cmfish.com/cd/cd.php?id=121&hot=1578','2018-04-06 05:34:25',121,1578,'2011-06-01','海南宏润水族','翁先生','13976858305/qq1095163258','hongrun818@qq.com','海南省琼海市潭门','海水观赏鱼，珊瑚软体，活石等，有专业捕捞船队，品种多样，保证质量，信誉第一。',19.247695,110.621900),(539,7,0,'http://www.cmfish.com/cd/cd.php?id=117&hot=1392','2018-04-06 05:34:26',117,1392,'2011-05-22','上海轩海宠物用品有限公司','李子龙','15921339752','401752701@qq.com','上海市普陀区远景路497号','专业经营中高档水族箱/鱼缸、酒店海鲜池、假山园林景观工程、工程设计、鱼缸保养、鱼缸服务、生物保养等。',31.260891,121.448019),(540,7,0,'http://www.cmfish.com/cd/cd.php?id=100&hot=1555','2018-04-06 05:34:26',100,1555,'2011-04-20','海南红海星海洋生物科技有限公司','米先